import { Container } from 'reactstrap';
import './App.css';

function App() {
  return (
    <Container>
      <div class="jumbotron">
        <h1 class="display-4 d-flex justify-content-center">Welcome..</h1>
        <p class="lead">My name is Scott Steinmetz and this is my website.</p>
      </div>
      <div class="d-flex justify-content-center">
        <div class="jumbotron">
          <h1 class="display-4">Welcome..</h1>

          <hr class="my-4"/>
          <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
          <p class="lead">
            <a class="btn btn-primary btn-lg" href="#" role="button">Learn more</a>
          </p>
        </div>
      </div>
    </Container>
  );
}

export default App;
